    t1 = this.pageMap;
    t1.$indexSet(t1, "Start: Recollections", $.EgbScripterPage$(["You remember the first time you saw the captain in that joint on Space Station Trust. You were both drunk beyond belief, both for different reasons. Come to think of it, _everybody_ in that bar was drunk beyond belief, _and_ for different reasons. In a way, it was like a group therapy session, only with less weeping and more yelling at each other from close up. ", "Of course, it didn't take long before someone started a fight. You don't really remember who it was, but it wasn't captain Kay, and it definitely wasn't you. You both got dragged into it pretty quickly, though, and because you were both sitting close to one end of the bar, according to bar fight customs, you were on the same side. It was impossible to _not_ notice the captain because he was laughing his head off in the midst of all the violence and craziness. ", "You remember trying to slip through the crowd to get out, as you had no intention of getting the hell beaten out of you for no reason whatsoever, and when you were next to the laughing captain, a huge furry with arms the size of your thighs leaped in front of you two, said: \"What's so funny, shitface?\", grabbed both of your heads, and smashed them together.", "The next thing you knew, the bar was empty and captain Kay helped you on your feet. There was dry blood in his hair. He was still laughing.", new $.anon6(this), "There is no reason why _you_ should outlive the captain. Or why you should outlive _any other_ crew member for that matter. You were always the weakest, thinniest person on board. The contagion, or whatever it is, should have killed you long before everyone else. Then again, there was absolutely no sense in the order in which the crew died. It was random.", "[IMG]", "The intercom on the wall starts ringing loudly and blinking with a red light. The ringtone and the color-coding means \"to all crew\" -- in other words: \"everyone in their ability should pick this up\".", [null, $.makeLiteralMap(["string", new $.anon7(), "goto", "Ignore"]), $.makeLiteralMap(["string", new $.anon8(), "goto", "Pick it up"])]], false, false));
    t1 = this.pageMap;
