    t1 = this.pageMap;
    t1.$indexSet(t1, "Start: Coming", $.EgbScripterPage$([new $.anon16(this), "[IMG]", "You follow Corridor Right \u2013 a badly lit tube of dusty cables and fluorescent lamps running along the right side of the Bodega, from the bridge all the way to the huge cargo area in the back. The stark white light of the lamps is not the only light source. There are also the red bulbs of the ship alarm which have been pulsing since the beginning of the disease 14 days ago.", [null, $.makeLiteralMap(["goto", "Bridge: Gorilla incident"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Bridge: Gorilla incident", $.EgbScripterPage$(["## The Gorilla", "There really is a gorilla on the bridge. But it isn't touching any of the electronics, let alone the control panel. It just sits there on the floor, full of melancholy, looking out the window at the stars. When you enter, it slowly turns to you and pushes out its huge lower lip. ", "[IMG]", "It's your Enhanced Gorilla. These species are used throughout the universe for hard manual labor: in construction, in the military, and on big tankers and cargo ships like the Bodega. Their intelligence is somewhat improved over what nature has given them -- they can understand basic spoken commands and they have the ability to communicate back via sign language. The vocabulary consists of the words \"food\", \"sleep\" and \"want\", and only a few others. But people don't need Enhanced Gorillas to be eloquent or nuanced. They need them to lift and push and sometimes smash. _Your_ gorilla mostly carries extremely heavy fuel cells from the storage to the socket in the engine room. ", "Your gorilla doesn't have a name. You call him 'Gorilla', as is common with these creatures. Nobody wants to get too attached to them. They die a lot.", "Gorilla raises his arms to sign. First, he makes the sign for \"me\" and then he makes the sign for \"sleep\". He obviously doesn't want to say that he is sleeping. More likely, he's trying to use his limited vocabulary to communicate that he is sad. But you can never be sure.", [new $.anon17(), $.makeLiteralMap(["string", new $.anon18(), "script", new $.anon19(this)]), $.makeLiteralMap(["string", new $.anon20(), "script", new $.anon21(this)])], "\"The gorilla stays,\" you say to the ship computer. \"He just sits there. And he definitely won't touch anything while I'm here.\" ", "The ship is silent for a while. Then she chooses to ignore the topic entirely.", "\"I would just _hate_ to unnerve you,\" she says, \"but considering that there is no reason to believe you are _not_ contaminated with the same illness as everyone else, and that we have no reliable data on the incubation period, I propose we make the jump to Space Station Unity as soon as possible. The hyperdrive seems to be operational now.\" ", [null, $.makeLiteralMap(["string", new $.anon22(), "script", new $.anon23()]), $.makeLiteralMap(["string", new $.anon24(), "script", new $.anon25()])], "The Bodega takes some time to go over a quick succession of data tables and schematics on the main screen. Then, she says: \"The drive is being charged now. It will be ready in ten to fifteen hours, depending on energy input.\" ", [null, $.makeLiteralMap(["string", new $.anon26(), "goto", "Full speed"]), $.makeLiteralMap(["string", new $.anon27(), "goto", "Shields on"])], "// TODO: (?) more options here: let player on/off shields, radar, independently"], false, false));
