    t1 = this.pageMap;
    t1.$indexSet(t1, "Bridge: Shields on", $.EgbScripterPage$(["\"That is... considerate,\" the ship replies. \"I will be using the radar only to periodically check for trouble. In between, I'll divert the energy to the drive. That should shave one or two hours off the charge up time.\" You hear and feel the hum rising from the engine room.", new $.anon29(this), [null, $.makeLiteralMap(["goto", "Repairs"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Bridge: Repairs", $.EgbScripterPage$(["## Repairs", "You are dog-tired. You spent the last couple of weeks slaving away \u2013 together with Gorilla and captain Kay \u2013 to repair the hyperdrive. It had broken down in the middle of nowhere after one of the containers in the cargo bay exploded. Apparently, the explosion was due to some inapt handling by none other than your Gorilla. It wasn't a particularly big blast, but the vibrations rippled through the whole ship, and -- among other things -- put the hyperdrive into an invalid state. As it turned out, though, the malfunctioning drive was to be the lesser of your worries.", "While you were patching up the drive, the rest of the crew were busy dying. One by one. The ship's medic was one of the first to go, but he didn't appear to have any idea about what was going on anyway. He was as scared and angry and clueless as anyone else. ", "\"It's not like I wasn't expecting to die out in the space one day,\" he said to you from behind a window (back then, the captain still tried to mantain some kind of quarantine), \"but I sure as hell didn't expect it to come _this_ soon.\" He was forty-five, one of the oldest crew members. He died the next day.", "[IMG]", "The only thing that has kept you from worrying about death so far was work. Anything else leaves too much brain capacity to imagination. Going to sleep has been particularly hard because there is always the possibility you'd never wake up.", "This time, though, you are so unbelievably tired you will probably fall asleep the minute you close your eyes. On the other hand, there is still work to do -- small things that also broke down because of the explosion, but weren't a priority.", [new $.anon30(this), $.makeLiteralMap(["string", new $.anon31(), "goto", "A nap"]), $.makeLiteralMap(["string", new $.anon32(), "goto", "Door repair"]), $.makeLiteralMap(["string", new $.anon33(), "goto", "Scanner repair"]), $.makeLiteralMap(["string", new $.anon34(), "goto", "Engine repair"]), $.makeLiteralMap(["string", new $.anon35(), "goto", "Jets repair"]), $.makeLiteralMap(["string", new $.anon36(), "goto", "Cargo bay repair"])]], false, false));
