    t1 = this.pageMap;
    t1.$indexSet(t1, "Bridge: A nap", $.EgbScripterPage$([new $.anon38(this), "You have a dream about how you wake up and you're already on Station Unity and a person in a white lab coat tells you that you're just _fine_ \u2013 healthier than ever, actually \u2013 and now that same person is a captain of a very nice ship and he is on the bridge \u2013 in that lab coat, but for some reason it's not weird at all \u2013 and you have a job on this new ship, too, and it's clear that you're comfortable and happy, and you're actually _laughing_, laughing while working, because the feeling of not needing to worry about stuff is just so uplifting and downright _euphoric_ right now. It's a very nice dream and when you feel you're starting to wake up from it, you genuinely don't want to.", [null, $.makeLiteralMap(["goto", "Dogfight: Start"])]], false, false));
