    t1.$indexSet(t1, "Dogfight: Radar reading", $.EgbScripterPage$([new $.anon40(this), "You wake up to regular bleeps of the radar. ", "\"I repeat,\" the ship says, quite urgently. \"We have a radar contact.\" ", "You look at the radar screen. It seems some smaller vessel is nearing rapidly. It doesn't seem like a pirate (those tend to bigger or more numerous), but the behaviour is highly unusual. Who would want to get this close to another ship in deep space, without any previous communication?", new $.anon41(this), new $.anon42(this), "Shortly afterwards, the vessel is in visual range. It's a Messenger class ship, a fast clipper about tenth of the size of The Bodega. If it's hostile, it could still pose a serious threat, but would probably run a big risk itself.", "[IMG: Bodega and Messenger face-to-face]", "The ship glides to a halt in front of the bridge, face to face with The Bodega. After a while, the communications panel lights up. There is an incoming call from the Messenger. ", [null, $.makeLiteralMap(["goto", "Encounter"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Wake up", $.EgbScripterPage$([new $.anon43(this), "You open your eyes, look out the window, and immediately jump up. There is a small -- though potentially dangerous -- ship right in front of the window, facing the Bodega. It's armed, but likely not a pirate, judging from the class of the ship (a Messenger, much smaller than the Bodega), by the fact it appears to be alone, and by the fact you're still alive.", "[IMG: Bodega and Messenger face-to-face]", "Before you can act, the communications panel lights up. There is an incoming call from the Messenger. Before you take it, you can either command the ship to raise the shields or to power up the utility laser on the nose of the Bodega. Doing both would take too much time to have any effect.", "// TODO: possibility radar is down but shield is up", new $.anon44(this), [null, $.makeLiteralMap(["string", new $.anon45(), "script", new $.anon46(this)]), $.makeLiteralMap(["string", new $.anon47(), "script", new $.anon48(this)]), $.makeLiteralMap(["string", new $.anon49()])], [null, $.makeLiteralMap(["goto", "Encounter"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Encounter", $.EgbScripterPage$(["The main screen fills with a large, bored face of a pilot with a large jaw and short hair. He's not even looking at the console, being busy with some controls to his lower left. ", "\"Calling the crew of the Bodega,\" he starts reciting, absently. \"This is...\" ", "Then he looks up, sees you on the screen, and stops abruptly.", "\"Oh!\" he says. \"Oh _fuck!_\" ", "Gorilla, which has been silently sitting on the ground to your left until now, starts hissing through clenched teeth, eyes wide open. It rocks back and forth, visibly disturbed. The pilot begins to frantically push some buttons on the panel in front of him. \"Oh fuck oh fuck oh _fuck!_\" he keeps repeating.", new $.anon50(this), "The communications panel goes blank as the pilot closes the connection. The Messenger starts moving to the side while raising shields. He knows that his best bet is to be moving all over the place.", "You try to remember something about spaceship combat, but there's not much you ever knew about the topic in the first place. You never had any ambition to go the the military, not even as a teenager, and you spent the last ten years of your life on cargo ships like the Bodega. Those normally don't get into combat, and if they do, it tends to be over quickly, and not in the cargo ship's favor. Plus, only those on the bridge get involved, whereas you practically live in the engine room.", "It's not _all_ bad, though. The Messenger is clearly not a combat vessel. You can only see 2 parallel beam guns in the front, and those seem pretty weak. The hull is slender. Moreover, according to the markings on the side, the ship is a Sentaco corporate runner. Sentaco \u2013 although one of the biggest corporations out there \u2013 is not one of the militarized ones. It deals in food and consumer goods. ", "The frail Messenger clearly wasn't sent here to fight the huge pile of steel that is the Bodega. But it _is_ fighting it now, for whatever reason.", [null, $.makeLiteralMap(["goto", "Fire loop"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Fire loop", $.EgbScripterPage$(["TODO: choice between critical hits, harassing, main engine hits, secondary jets hits, gun hits, contacting\nTODO: choice to do nothing - and get slowly obliterated\nTODO: when hit in the right places, the Messenger gets penalties (easier to hit, longer to reload, \nTODO: ? messenger can get to a blind spot behind the Bodega - 1 turn to turn in his direction \nTODO: if scannerUp => more info about Messenger\nTODO: if messanger's guns are gone - release probe, try to withdraw\nTODO: if messanger is too damaged - release probe, try to withdraw\nTODO: messenger can hit left or right side of the hull critically. Later, that corridor will be inaccessible (need to go around)\nTODO: \"Direct all halogen headlights on the Messenger and switch them on at once\"\nTODO: player needs to keep track of resources (energy cells, ammo?)", "<p class=\"meta\">This is where a space combat simulation will happen. Choices made by player will not only affect the combat, but also the state of the ship afterwards. Right now, we skip this.</p>", "TODO // meta // This is your first spaceship combat. This box will explain the machanics of a fight in space.", "TODO // meta // There are a couple of things to keep in mind. First, there's the **structural integrity** (STR) of your ship. The more you get hit, the worse it gets. (If you're at 0% SI, the ship falls apart.). Second, there's **shields** (SHD). They are an semi-transparent forcefield that a ship can raise in the direction of incoming fire. (If they're up, most projectiles won't get through to the ship hull, so the ship's structural integrity is protected.) Third, there's **positioning** (POS), which is an index of how well your ship is located in three-dimensional space, towards others. (If your opponent outmaneuvers you and is facing the most vurnerable side of your ship, for example, your POS will be very low.) Fourth, there's **aim** (AIM). It's how well a ship is able to hit its target. (The higher the AIM, the higher probability there will be of hitting the target, and, moreover, of hitting a vital part of the target.) And fifth, there's **accumulated energy** (ENR), which is the excess energy your engine produces but doesn't spend on the essential \u2013 like jets, shields, or life support. (That energy can then be used for special combat moves and abilities.)", "TODO // meta // There is no single strategy that will always work. For example, if you focus solely on your shields, your opponent can outmaneuvre you and make those shields \u2013 at least temporarily \u2013 irrelevant (remember, shields are directional, they can't be around your whole ship). If you focus solely on positioning, your opponent can focus on aiming, and \u2013 unless he gets into a really bad position \u2013 he can still blow you up. You should always play your cards according to situation.", [null, $.makeLiteralMap(["string", new $.anon51(), "goto", "Win"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Resolution", $.EgbScripterPage$([new $.anon52(this)], false, false));
