    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Win", $.EgbScripterPage$(["This time, the beam must have drilled through to the core, because there is a violent explosion on the Messenger. Only the skeleton of the ship stays put, the rest is blown away from the inside, in all directions.", new $.anon53(this), "TODO: only if messenger hasn't done it during fight\nOne of those outward flying parts is different from the others, though. It steers itself. Apparently, the Messenger's pilot (or his ship's computer) managed to launch a small robotic probe just before the spectacular explosion. The thing beelines through the flying debris and hits hard somewhere near the Bodega's cargo bay. ", "\"Hull breach,\" the ship says, laconically. \"Initiating sealing process.\" TODO: explain sealing process", "You look at the readings around you. The shields are at TODO % and stable. The hull took \u2026 damage. ", "Captain Kay was always saying: \"When shit happens, it happens all over the place.\" ", "On the plus side, though, you _are_ still alive.", [null, $.makeLiteralMap(["goto", "Why?"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Dogfight: Why?", $.EgbScripterPage$(["You try to imagine why the Messenger came here and why the pilot acted the way he acted. Was he just so stupid to try to pick a fight with a much sturdier ship? Was he expecting to find something else here? Or someone else? Did he know about the disease? Was he acting on his own, or was this an official Sentaco run? Is Sentaco a pirate company now? Why would it be interested in the Bodega, of all ships?", [null, $.makeLiteralMap(["goto", "Explore: Start"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Explore: Start", $.EgbScripterPage$(["## The crew of one", "The Bodega is now running a full system check, all the monitors flicker with information so fast only a computer could make anything of it. \"What the _hell_ is happening?\" the ship says, her voice glitching. \"How does one go from a fully manned, well-preserved, licensed cargo ship to a _ghost_ ship piloted by an idiot machinist _while_ being attacked by a corporate runner for no apparent reason \u2013 in two weeks!?\" ", [null, $.makeLiteralMap(["string", new $.anon54(), "script", new $.anon55()]), $.makeLiteralMap(["string", new $.anon56()])], "\"Okay, this is all so totally outside the protocol,\" the Bodega continues. \"We'd be full speed somewhere past Algol if it wasn't for the idiot Gorilla of yours in the cargo bay. Nobody would be dead. The disease would be someone else's problem. And there would be someone _actually capable_ on the bridge.\" ", "The flow of information on the monitors stop, and they all go to their default view. \"Who were we kidding? The whole thing is _your_ fault. If you watched the beast \u2013 as you're _required by the protocol_, by the way \u2013 there would be no explosion, no contagion, no deaths, and no using the utility laser to end a Messenger that was probably just trying to help.\" ", "\"I just hope you die real soon so I can go to emergency autopilot mode and get to somewhere civilized.\" ", "- \"What is this, a mutiny? Are you trying to kill me?\" // don't be an idiot, I can't kill you\n- \"You realize you wouldn't be going anywhere if I hadn't just spend days to fix the hyperdrive?\"\n- \"Whatever.\"\n// TODO bodega's reactions", new $.anon57(this), new $.anon58(this), [null, $.makeLiteralMap(["goto", "Bridge Lookaround"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Explore: Bodega's layout", $.EgbScripterPage$(["[IMG bodega's layout]", [null, $.makeLiteralMap(["goto", "<<<"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Explore: Bridge", $.EgbScripterPage$([new $.anon59(this), new $.anon60(this), [null, $.makeLiteralMap(["string", new $.anon61(), "goto", "Look at hull breach"]), $.makeLiteralMap(["string", new $.anon62(), "goto", "Bodega's layout"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Explore: Look at hull breach", $.EgbScripterPage$(["The object from the Messenger crashed into the right side of the cargo bay. It managed to drill through the hull \u2013 as evidenced by the suddenly lower air pressure in the whole area \u2013 but fortunately the Bodega managed to isolate the impact zone with hermetic curtains. This means there is an area in the cargo bay that is presumably quite damaged, almost surely without air, and separated from the rest of the space by relatively thin, makeshift firewalls.", "The protocol states that these firewalls will stay down until the hull breach is patched. ", new $.anon63(this), [null, $.makeLiteralMap(["goto", "<<<"])]], false, true));
