    t1.$indexSet(t1, "End: Password", $.EgbScripterPage$(["You put the password in and the computer accepts it. The last log entry appears again.", [null, $.makeLiteralMap(["string", new $.anon66(), "goto", "Other log entries"]), $.makeLiteralMap(["string", new $.anon67(), "goto", "Search database"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Other log entries", $.EgbScripterPage$(["\"Something in one of the containers in E4 exploded. The shockwave damaged a shitload of neigbouring cargo. Larry says there was nothing fragile around, and that it's no big deal, but Larry is a lazy fucktard. I glanced at the manifest and saw that there is fragile stuff all over E4. I still haven't gotten to inspect the damages and mark it into the database, though. I hate to think how much money we lost because of some idiot not disclosing volatile chemicals.\" ", "// TODO lead up to \"I want to be dying forever. I never had any idea! It's so ecstatic! So focused and discrete and full of beautiful beautiful hope it makes me laugh at my own previous foolish fear of this moment and my insistence and clinging on something as worthless and selfish as life. Why did I never allow myself to die before? What was I afraid of?\" ", [null, $.makeLiteralMap(["string", new $.anon68(), "goto", "Search database"])]], false, true));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Search database", $.EgbScripterPage$([new $.anon69(this), [null, $.makeLiteralMap(["goto", "Choose search"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Choose search", $.EgbScripterPage$([new $.anon70(this), [new $.anon71(this), $.makeLiteralMap(["string", new $.anon72(), "goto", "Other log entries"])], "// TODO: iterate and let player filter out, each search costs time (worse health)"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Found order", $.EgbScripterPage$(["And then, there it is. Even before you open the order, you already know this is the one. The description says: _Research equipment_. The Bodega loaded it at the Ithaka Logistics Orbital Depo a month ago. Its point of origin was at Ithaka's surface, at the Sentaco-Exaport R&D Facility. Its final destination: Sentaco XI Space Station, Solar system. Quite a distance. ", "The client is not Sentaco, though. It's a company called Ithaka Leasing Services (TODO: put ILS on the exploded container). It might be a Sentaco subsidiary, or a contractor. TODO make less obvious", "There is a delivery note attached to the order. These are conveyed to the recipient upon delivery. This one says:", "    Dr. Eleanor Wells' lab equipment from Ithaka. Notify Dr. Pruitt, mention: \"wolfberry\". Not sterilized.", "A surge of rage overcomes your brain. You hear loud pulse in your ears and the world gets muffled and distant. \"Not sterilized.\" God knows what sick shit was still living inside that equipment. It's required by law to sterilize anything that could \u2013 even with the remotest of possibilites \u2013 be contaminated. Someone's _laziness_ just killed eleven people. The twelfth one is on his way.", "At least you have someone to ask about this now. Dr. Wells or Dr. Pruitt ought to have the answers. They might know what exactly got out. And if you're lucky, one of them might even know how to fight it.", [null, $.makeLiteralMap(["string", new $.anon73(), "goto", "Go to bridge"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Go to bridge", $.EgbScripterPage$(["# Death", "You leave the captain's cabin and head to the bridge, when suddenly you fall to your knees. At first, it's just like your legs temporarily gave out, but then comes the pain. Immense, excruciating pain, coming from the marrow to the skin. You fall on the side and open your mouth to scream, but only a squawk comes out.", [null, $.makeLiteralMap(["string", new $.anon74(), "goto", "Wait if it fades"]), $.makeLiteralMap(["string", new $.anon75(), "goto", "Call gorilla"]), $.makeLiteralMap(["string", new $.anon76(), "goto", "Crawl towards the bridge"])], "- Crawl to the right (away from bridge, towards the engine room) // cures for a while"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Call gorilla", $.EgbScripterPage$(["You crawl to the nearest intercom handset and, sorely, you reach up to it and set it to broadcast. You take a few seconds to subdue the pain, then speak.", "\"Gorilla.\" You cringe. \"Go. To. Master.\" ", "// gorilla tries to help, but falls with similar seizure"], false, true));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Crawl towards the bridge", $.EgbScripterPage$(["You crawl along Corridor Left. Every single movement is pure pain, and your whole body perspires with cold sweat. The bright white light and the buzzing of the lamps is unbearable.", "After what feels like hours of hell itself, you look back, and the captain's cabin is just there, a couple of strides behind your feet. You're not even in one tenth of the way.", "// player needs to crawl to engine room, get 'cured', then go to bridge\n// player manages to get to bridge"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Arrive bridge", $.EgbScripterPage$(["// TODO: start a new timeline with last symptoms", "Still a bit shaken, you arrive at the bridge. The view of outside /* TODO: what is outside? */ is nauseating, so you try to keep it out of your field of vision by bowing your head.", "\"I need to make a call,\" you say. \"I need to get to a comms beacon.\" ", "The Bodega puts up a map on the main monitor, but you can't bear to look at it, it makes you retch. It's too bright and it moves constantly.", "\"The closest FTL beacon is Station Unity. There's also one farther away, at the Belt III Shipyard. We should be able to get there, but it will take a at least one more hour.\" ", "\"Is there nothing else around here?\" ", "\"Well, there's the abandoned Station Shannon. They obviously had FTL comms, but that doesn't mean the beacon is still there. I mean, it's still in the directory, but it doesn't seem anyone has made any calls from there lately.\" ", "- Jump to Station Unity\n- Jump to Station Shannon // not working, probably plundered, chance to describe this place\n- Jump to Belt III Shipyard"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Making the call", $.EgbScripterPage$(["The Bodega starts linking itself to the comms beacon. It takes ages.", new $.anon77(this), "Finally, the comms panel goes green. You can make your call.", "- Call Dr. ___ Pruitt\n- Call Dr. Eleanor Wells"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Call Pruitt", $.EgbScripterPage$(["// TODO: call Dr. Pruit: watches. calls Sentaco ship.", [null, $.makeLiteralMap(["goto", "Call Wells"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Call Wells", $.EgbScripterPage$(["You tell Bodega to call Eleanor Wells and the monitor starts filling with information about the connection being established. The handle 'ewells' shows up all over the place. It's hers.", new $.anon78(this), "A chime sounds and Dr. Eleanor Wells is on the main screen. She looks tired and angry. The room at the other end is dim.", "\"Look, it's 4am and I wake up in 2 hours from now. I'm too old for this.\" She pauses for a moment. \"Who the hell are you?\" ", [null, $.makeLiteralMap(["string", new $.anon79(), "script", new $.anon80(this)]), $.makeLiteralMap(["string", new $.anon81()]), $.makeLiteralMap(["string", new $.anon82()])], "Before you can reply, another seizure strikes.", new $.anon83(this), "Dr. Wells eyes are now wide open. She looks around herself, checking that no one else is present, then she comes closer to her comms panel.", "\"Are you... have you taken Rescin?\" ", [null, $.makeLiteralMap(["string", new $.anon84(), "goto", "It was accident"]), $.makeLiteralMap(["string", new $.anon85(), "goto", "Wtf is Rescin"])], "// TODO: keep track of 'attitude' => if too harsh, will later be harsh back"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Wtf is Rescin", $.EgbScripterPage$(["\"You don't _know?_ But how... You're obviously in the last stage. Someone had to contaminate you. Was it Pruitt?\" ", "You say: \"I have no idea who it was, if anyone. There was an explosion on the ship.\" ", [null, $.makeLiteralMap(["goto", "It was accident"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: It was accident", $.EgbScripterPage$(["\"What happened?\" ", "\"A container exploded in the cargo bay. It damaged some research equipment from Ithaka, among other things. Then people started dying.\" ", new $.anon86(this), "Dr. Wells watches you in horror. \"Dying? People started _dying?_ How many?\" ", "\"Eleven.\" ", "All color leaves Dr. Wells' face. \"Eleven,\" she repeats. Her face is torn in a terrified grimace. \"How. How did they die?\" ", "\"Like I'm dying now. They got sicker and sicker, and then they just stopped breathing.\" ", "\"And then?\" ", "\"What do you mean, 'then'?\" Every word you say, every breath you take, hurts. \"They. Fucking. Died!\" // TODO: choice", "\"But what did you do with the bodies? Where are they now?\" ", "\"Don't worry,\" you lower your voice. \"We're not that stupid. We airlock'd them. But even without the bodies, others got sick.\" ", "\"Airlock'd?\" ", "\"We let them out. To outer space.\" ", "\"Jesus Christ,\" Dr. Wells says. Her mouth stays open, her eyes absently roam over her room. \"Jesus Christ.\" She thinks for a minute, then suddenly springs into action and starts writing something on a keyboard that's out of view. ", "\"I am sending you some of the research we did on Rescin. You'll need it later. Now, listen,\" she looks back at the camera. \"Do not fight it. I know it hurts, but do _not_ fight it.\" ", new $.anon87(this), "\"This is normal,\" Dr. Wells says. \"We were not able to make these side effects disappear. That's why the research was scrapped. We knew we would never be able to pass the regulations for human testing, and without that, we could never hope for Rescin to help people.\" ", "- \"How does it help?\"\n- \"You call this help? Are you retarded? I'm _dying_.\" ", "\"We developed Rescin \" ", "- How does Rescin work?\n- Why does it hurt so bad?", "// TODO: do NOT let the player know that he will be ressurected - only disclose about the nanobots"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Nice Death", $.EgbScripterPage$(["This time, it's different. Your are losing your peripheral vision. The only thing you see now is the blindingly bright face of Dr. Eleanor Wells. She's saying something to you, but you don't hear it. The only thing you hear is something you've never heard before in your life \u2013 your body. Not just the blood in your veins, but everything. The complex, moist, organic machine that is your physical body. It is slowing down.", "// TODO: make it frightful experience when attitude is too strong (?) (or some other player driven thing)", "All the pain, all the weight is gone. It's beautiful. There's just you, your body, and the shining eyes of Eleanor Wells, who is now also your mother, and she's still talking to you, and you still don't hear, but that doesn't matter, it's so pleasant and charming you just want to snug in the warmth and bathe in the light.", "- Snug in the warmth and bathe in the light\n- Try to stay up"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Snug", $.EgbScripterPage$(["You let the wave of warmth and light that was your mother's eyes just a moment ago come to you and cuddle you and, finally, merge with you. You are the light now.", "And then, peacefully, you fade out.", [null, $.makeLiteralMap(["goto", "Death"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "End: Death", $.EgbScripterPage$(["This is the end.", "You die.", "..", "..", "..", "Cold floor.", "No other sensation.", "Then, once again, you hear the blood humming in your veins. ", "The pain is back, too, but this time, it's not entirely unpleasant. It's like the pain is driving the death away, so you welcome it.", [null, $.makeLiteralMap(["string", new $.anon88(), "goto", "Ressurection: Open eyes"])], "- TODO: something else, like Try to move, Get more rest"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Open eyes", $.EgbScripterPage$(["Your eyes open, shakily. ", "You haven't moved since you ... died. You lie on the floor, next to the communications panel, and your eyes are still fixed on the main monitor. ", new $.anon89(this), "\"You're back,\" she says. \"Good. We don't have much time.\" ", "- \"Why?\"\n- Stand up\n// both fail\n// TODO: monitor \"inquisitive\" - the more inquisitive, the more Eleanor will like player", new $.anon90(this), [null, $.makeLiteralMap(["string", new $.anon91()])], "Dr. Wells detects your question. \"What the nanobots do \u2013 after they've gathered data about your body \u2013 is they pretty much rebuild it all, cell by cell. Some of the nanos will merge with a cell, effectively making a cyborg microorganism. Most will use your body's own mechanisms and resources to augment its function. Striking the right balance between the two approaches \u2013 it was pure alchemy. Well, it was all alchemy, mostly.\" ", [null, $.makeLiteralMap(["string", new $.anon92(), "script", new $.anon93()]), $.makeLiteralMap(["string", new $.anon94()])], "Dr. Wells draws closer to the camera. \"Are you familiar with the Verge?\" ", [null, $.makeLiteralMap(["string", new $.anon95(), "goto", "No need to explain Verge"]), $.makeLiteralMap(["string", new $.anon96(), "goto", "Explain Verge"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Explain Verge", $.EgbScripterPage$(["// TODO painful to shake"], false, true));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: No need to explain Verge", $.EgbScripterPage$(["\"Of course, you're pretty much in it right now. But let me tell you, life on a starship in the Verge is _nothing_ like life on the moons and the planets of the Verge.\" ", [null, $.makeLiteralMap(["goto", "Reminiscing Verge"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Reminiscing Verge", $.EgbScripterPage$(["Dr. Wells leans back and narrows her eyes. \"I was raised on one of the Verge's poorer star systems, Avesta. We lived on a hot, seizmic power-plant of a planet, Avesta II. See, nobody even cared enough to give it a proper name.\" She scoffs. \"The population was fifty thousand. Together, they provided the 'colonization effort' with more energy than the _whole_ Sol system combined.\" ", "She scoffs again. \"And for those fifty thousand people \u2013 who worked twelve hour shifts in artificially lit, hell-hot underground tunnels on a volcanic planet \u2013 there was just one real doctor. My father. And so I lived among broken people. No matter how hard my father tried, there was always screaming and people with dripping burns and with missing limbs.\" ", [null, $.makeLiteralMap(["string", new $.anon97(), "script", new $.anon98()]), $.makeLiteralMap(["string", new $.anon99()])], "\"I eventually got out of Avesta, out of the Verge, to study medicine with some of the most intelligent people I will ever know. Most of them from central systems, of course. And, see, I learnt that these people \u2013 coming from where they do \u2013 these people think it's 'not natural' to help people who are beyond some 'level of damage'. When a worker somewhere in the Verge gets his legs caught in machinery, they say it's 'natural' that he loses the whole lower part of his body, because that would have happened a hundred years ago. Is it possible to help him now? Maybe, but they think it would be crossing a line. Of course, most of them have never even _seen_ anyone lose their legs.\" ", "\"Fortunately, not everyone was so arrogant. We put together a working group and started looking into technologies that were 'beyond the line'. The most promising one turned out to be nanorobotics. We got funded by Sentaco and set up the lab on Ithaka.\" ", "The Bodega jumps in. \"There's a new signal on the radar. A medium sized ship. I just thought you two might want to know.\" ", "\"I'm sure you'll learn that the ship was sent by Pruitt. I told you we don't have much time. How do you feel?\" ", "You don't feel so great, but definitely better than a minute ago.", "- \"Not so great.\"\n- \"Better.\"\n- \"I almost died, that's how I feel.\" // \"No, you actually died.\"\n- \"Why do you care?\" ", "// TODO: I can see your vocal cords are getting better.", "\"Look \u2013 Pruitt's men are coming for you. I'm not entirely sure if this all is an accident or not, but even if it was, Pruitt will definitely want to have you for research. You're the only human in the universe with Rescin treatment. And unless I am mistaken, you'll be the only one for some time to come.\" ", [null, $.makeLiteralMap(["string", new $.anon100(), "goto", "Try to get up"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Try to get up", $.EgbScripterPage$(["You try hard to rise up, but even just moving your arms underneath the body, so that you can push up, turns out to be impossible. You give up and immediately, a tingling sensation overcomes all the muscles you just stressed.", "Dr. Wells nods. \"You're not ready yet, but don't worry, you'll be in a few minutes.\" ", [null, $.makeLiteralMap(["goto", "Questions"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Questions", $.EgbScripterPage$([[new $.anon101(), $.makeLiteralMap(["string", new $.anon102(), "goto", "Stand up again"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Stand up again", $.EgbScripterPage$(["// TODO: first 2 attempts in vain (unless all questions have been answered)\n// TODO: one of the attempts: Bodega says how far the incoming ship is", "This time, it works. You push your hands towards the floor and your upper body lifts as easily as if the gravity was turned down. The tingling sensation is all but gone. You stand up and look around. The bridge is as empty as when you got here a few hours back. You notice the radar screen and the highlighted ship that is slowly moving towards the center of it. Amazingly, you can read the distance measurement, although the characters are small and the screen is a few meters away. The ship is 11 kilometers away and approaching the Bodega with an ETA of 5 minutes.", "- \"The ship's here in 5 minutes. All energy to shields and weapons.\"\n- \"Give me a reading of the ship.\" ", "TODO: reading of the ship\nTODO: Dr. Wells disapproves"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Ressurection: Eleanor advice", $.EgbScripterPage$(["\"I'm pretty sure the Bodega is no match for that ship.\" ", "\"Excuse me?\" the Bodega says. ", "\"Look, ship, I know about the Messenger. Good job. But they won't make the same mistake again. That incoming ship is military class. She's smaller than you, I'm sure, but you have absolutely zero chance of beating her in your current setup. You're better off playing dead.\" ", "The Bodega runs through some schematics on the scanner panel for a fraction of a second, then says: \"I'm afraid she's right. That ship appears to be a military-grade vessel. A gunship.\" ", "\"Play to your strengths,\" Dr. Wells says. \"They want you alive.\" ", [null, $.makeLiteralMap(["string", new $.anon103(), "script", new $.anon104()]), $.makeLiteralMap(["string", new $.anon105()])], "The ship is now 4 minutes away.", "\"Look, I need to disconnect. They traced our call. It's best for me to move and stay hidden now. After this litter encounter is over, you do the same. I'll contact you later.\" Dr. Wells smiles. \"I think I'll have something the Bodega will enjoy. Until then, good luck.\" Dr. Wells nods and the main screen goes blank.", "What do you do?\n- Contact the ship and surrender to them // end\n- Raise shields and prepare for battle // very short battle, incapacitates bodega's weapons, continues with boarding\n- Let the ship approach"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Boarding: Start", $.EgbScripterPage$([new $.anon106(this), "// TODO: again possible to go around the whole ship\n// TODO: lose most of strength around the engine\n// take weapons \n// find gorilla, still stiff, possibility to move out of the corridor\n// make noise ?\n// hide (some places better than others)\n// mercenaries with masks\n// they go in 2 pairs, clockwise and ccw\n// player can hear them in adjanced rooms\n// walking in to room where they are = even fight\n// hiding in place where they're going = can wait various amounts of time, with more time = more chance of being detected, but also better advantage if not detected and possibility to let them through", "// fight itself is primitive, as they are much weaker - problem would be near engine room or with all 4 of them at once\n// the better the setup, the quicker fight, the better points"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Boarding: Fight 2 men", $.EgbScripterPage$([], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Boarding: All men down", $.EgbScripterPage$(["The four men are down. You carefully go through the breach and explore the inside of the gunship. There is no one else there, but you find some food and some energy cells. ", "Your current supplies are: TODO.", [new $.anon107(), $.makeLiteralMap(["string", new $.anon108(), "goto", "Get rid of the men"])], "You bring the supplies over to the Bodega. The extremely heavy fuel cells don't seem that way anymore. ", "There are now TODO energy cells and food for TODO days on the Bodega. You also scavenge some turret ammunition (TODO?).", [null, $.makeLiteralMap(["goto", "Get rid of the men"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Boarding: Get rid of the men", $.EgbScripterPage$(["You carry all the four men over to the gunship and come back to the bridge. The Bodega then pushes the gunship off while sealing the breach. In twenty minutes, the hull is sealed again, and the gunship slowly drifts away a few hundred meters to the right of the Bodega."], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: Start", $.EgbScripterPage$(["\"We probably shouldn't stay here too much longer,\" the Bodega says. \"The good news is, since you don't need to chat with your doctor girlfriend anymore, we can go pretty much anywhere. Places without comms beacons and outside main official routes seem like a great idea to me right now. We have a few options. Just note that we only have TODO fuel cells right now.\" ", "The Bodega highlights the options on a map on the main screen.", "- A (distance, fuel cells)\n- Outer space just outside effective radar ranges\n- C\n- D", "The Bodega puts in the coordinates for TODO and immediately starts rotating and charging the warp at the same time.", "- Watch\n- Go find Gorilla"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: Find Gorilla", $.EgbScripterPage$(["You go looking for Gorilla to where you last saw him, in TODO, but when you arrive, he's not there. The rebuild phase took longer in his case, for whatever reason (you can assume it's because of the proximity to the engine room and also the sheer mass of his body), but it has clearly passed.", "- Look for him in ___\n- Look for him in ___\n- Look for him in ___"], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: Gorilla in captain's cabin", $.EgbScripterPage$(["You enter the captain's cabin and lay your eyes on the most amazing thing you've seen since TODO.", "Gorilla \u2013 the massive monument of muscle and fur \u2013 is slouching on a chair in front of captain's computer. He's not just sitting there, though. He _actively uses the computer_, apparently reading some long article. When he sees you, he turns around and smiles.", "\"I went ahead and read most of what Dr. Wells sent to us,\" Gorilla says with perfect pronounciation and in a pleasant voice. \"It's fascinating.\" ", [null, $.makeLiteralMap(["string", new $.anon109(), "goto", "How?"])]], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: How?", $.EgbScripterPage$(["\"Oh, in many ways,\" says Gorilla. \"\" ", [null, $.makeLiteralMap(["goto", "Questions for Gorilla"])]], false, true));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: Questions for Gorilla", $.EgbScripterPage$(["- \"No, I mean, how are you able to talk this well?\" TODO change when not shown for the first time\n- \"How did you get the password?\" // saw captain put in the password countless times."], false, false));
    t1 = this.pageMap;
    t1.$indexSet(t1, "Finale: End", $.EgbScripterPage$(["Your jaw is still down in amazement when the Bodega starts talking through the PA. She doesn't bother to use the intercom anymore. ", "\"We just left the detection range of TODO and are on our way to TODO. In other words, you and your pet monkey are safe. You are welcome.\" ", "Gorilla raises his browridge. \"Actually, I am not a monkey. I am an ape. If I was a macaque, or similar, you could refer to me as a monkey. Am I a macaque, though? No. I am a gorilla.\" ", "At that moment, you realize: _this is how it's going to be here from now on._", "And the Bodega says: \"Great, thanks for the lecture.\" And then, after a couple of seconds, she says with a different voice: \"I suggest both of you apes come to the bridge. You might want to see this.\" "], false, false));
